import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div align="center">
        <Typography variant="h1" style={titleStyle}>
          Sign-up now to Play!
        </Typography>
        <Button color="secondary" variant="contained">
          Sign up
        </Button>
      </div>
    );
  }
}

export default Home;
